import React from "react";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import MDButton from "components/MDButton";
export default function MeetingModal({formData, handleClose,show}) {
    console.log(formData)
  return (
    <div>
      <Dialog
        open={show}
        PaperProps={{
          sx: {
            width: "800px", // Adjust the width to your desired size
            maxWidth: "none", // Ensure the max width is not constrained
          },
        }}
        onClose={handleClose}
      >
        <DialogTitle>Staff Details</DialogTitle>
        <DialogContent>

        <Box
                      component="form"
                      sx={{
                        '& .MuiTextField-root': { m: 2, width: '100ch' },
                      }}
                      noValidate
                      autoComplete="off"

                    >

                      <TextField
                        required
                        id="outlined-required"
                        label="Compmay name"
                        placeholder="Company name"
                        value={formData.cname}
                        onChange={(e) => { setFormData({ ...formData, cname: e.target.value }) }}
                      /><br></br>
                      <TextField
                        required
                        id="outlined-required"
                        label="Role"
                        value={formData.role}
                        onChange={(e) => { setFormData({ ...formData, role: e.target.value }) }}
                        placeholder="Role"
                      />
                      <TextField
                        required
                        id="outlined-required"
                        label="Eligibility"
                        placeholder="Eligibility"
                        value={formData.eligibility}
                        onChange={(e) => { setFormData({ ...formData, eligibility: e.target.value }) }}
                      />
                      <TextField
                        required
                        id="outlined-required"
                        type="date"
                        label="Open date"
                        placeholder="Open date"
                        value={formData.open_date}
                        onChange={(e) => { setFormData({ ...formData, open_date: e.target.value }) }}
                      />
                      <TextField
                        required
                        id="outlined-required"
                        type="date"
                        label="End date"
                        placeholder="end date"
                        value={formData.close_date}
                        onChange={(e) => { setFormData({ ...formData, close_date: e.target.value }) }}
                      />

                    </Box>
        </DialogContent>

        <DialogActions>
        <MDButton onClick={handleClose} color="primary">
            Close
          </MDButton>
        </DialogActions>
      </Dialog>
    </div>
  );
}
